    /**
     * Get all icons as an array for select options
     */
    public static function toSelectArray(): array
    {
        $icons = [];
        foreach (self::cases() as $icon) {
            $icons[$icon->value] = $icon->getLabel();
        }
        return $icons;
    }

    /**
     * Create a Game Icon instance for dynamic icon names
     * Useful when you need to use an icon not defined in this enum
     */
    public static function make(string $iconName): string
    {
        // Ensure the icon name has the proper prefix
        if (!str_starts_with($iconName, 'gameicon-')) {
            $iconName = 'gameicon-' . $iconName;
        }

        return $iconName;
    }

    /**
     * Get a random icon from the enum
     */
    public static function random(): self
    {
        $cases = self::cases();
        return $cases[array_rand($cases)];
    }

    /**
     * Search icons by label
     */
    public static function search(string $query): array
    {
        $query = strtolower($query);
        $results = [];

        foreach (self::cases() as $icon) {
            if (str_contains(strtolower($icon->getLabel()), $query)) {
                $results[] = $icon;
            }
        }

        return $results;
    }

    /**
     * Get icons by category (you can extend this based on your needs)
     */
    public static function getByCategory(string $category): array
    {
        $categories = [
            'weapons' => ['sword', 'axe', 'bow', 'gun', 'dagger', 'hammer', 'spear', 'mace'],
            'magic' => ['magic', 'spell', 'potion', 'crystal', 'rune', 'staff', 'wand'],
            'characters' => ['wizard', 'warrior', 'archer', 'rogue', 'paladin', 'knight'],
            'creatures' => ['dragon', 'wolf', 'bear', 'eagle', 'snake', 'spider'],
            'items' => ['armor', 'helmet', 'boots', 'ring', 'crown', 'chest', 'coin'],
            'dice' => ['d4', 'd6', 'd8', 'd10', 'd12', 'd20', 'dice'],
        ];

        if (!isset($categories[$category])) {
            return [];
        }

        $results = [];
        foreach (self::cases() as $icon) {
            foreach ($categories[$category] as $keyword) {
                if (str_contains(strtolower($icon->value), $keyword)) {
                    $results[] = $icon;
                    break;
                }
            }
        }

        return $results;
    }

     /**
     * Get the icon name with the "game-icons-" prefix.
     */
    public function getLabel(): string
    {
        return "game-icons-{$this->value}";
    }

    /**
     * Get the icon for a specific size (Filament).
     */
    public function getIconForSize(IconSize $size): string
    {
        return match ($size) {
            default => $this->getLabel(),
        };
    }

    /**
     * Force the icon to be the "thin" variant.
     */
    public function thin(bool $condition = true): string
    {
        return $this->forceWeight(Weight::Thin, $condition);
    }

    /**
     * Force the icon to be the "light" variant.
     */
    public function light(bool $condition = true): string
    {
        return $this->forceWeight(Weight::Light, $condition);
    }

    /**
     * Force the icon to be the "fill" variant.
     */
    public function fill(bool $condition = true): string
    {
        return $this->forceWeight(Weight::Fill, $condition);
    }

    /**
     * Force the icon to be the "duotone" variant.
     */
    public function duotone(bool $condition = true): string
    {
        return $this->forceWeight(Weight::Duotone, $condition);
    }

    /**
     * Force the icon to be the "bold" variant.
     */
    public function bold(bool $condition = true): string
    {
        return $this->forceWeight(Weight::Bold, $condition);
    }

    /**
     * Force the icon to be the "regular" variant.
     */
    public function regular(bool $condition = true): string
    {
        return $this->forceWeight(Weight::Regular, $condition);
    }

    /**
     * Force the icon to be a specific weight.
     */
    public function forceWeight(Weight $newWeight, bool $condition = true): string
    {
        if (! $condition) {
            return $this->getLabel();
        }

        $icon = $this->getLabel();

        return collect(Weight::cases())
            ->first(fn (Weight $weight) => 
                $weight !== Weight::Regular && str_ends_with($icon, "-{$weight->value}")
            )
            ?->pipe(fn (Weight $weight) =>
                $newWeight === Weight::Regular
                    ? str_replace("-{$weight->value}", '', $icon)
                    : str_replace("-{$weight->value}", "-{$newWeight->value}", $icon)
            )
            ?? ($newWeight === Weight::Regular ? $icon : "{$icon}-{$newWeight->value}");
    }
